import React from 'react';
import { BrowserRouter as Router, Route, Link, } from "react-router-dom";

function HomePage() {

    return (
        <Router>
            <center>
                <div className="homepage">
                    <p>Home page</p>
                    <Link to={'/components/RegisterForm'} style={{ fontSize: 20 }}></Link>
                </div>
            </center>
        </Router>
    );
}
export default HomePage;
